import React from 'react'
import logo_inshorts from './../images/impactwise logo 2000.png'
import './NavInshorts.css'
import HamburgerDrawer from './HamburgerDrawer'
import { useAuth0 } from "@auth0/auth0-react";

const NavInshorts = ({setCategory}) => {
  const { loginWithRedirect } = useAuth0();
  const { logout } = useAuth0();
  const { user, isAuthenticated, isLoading } = useAuth0();


  
  return (<>
    <div className='nav'>
      <div className='icon'><HamburgerDrawer setCategory={setCategory} /></div>
      <img className='logo' style={{cursor: 'pointer'}} src={logo_inshorts} height='80%' alt='logo'></img>
      
      <a target='blank' className="but">
        {isAuthenticated ? ( <button className='button-45' onClick={() => logout({ logoutParams: { returnTo: window.location.origin } })}>
      Log Out
    </button>)
    :
    ( <button  className='button-36' onClick={() => loginWithRedirect()}>Log In</button>)}
     
     
      </a>
    </div>
   
    </>
  )
}

export default NavInshorts
